import React from 'react';

function FavoriteCard({ recipe }) {
  if (recipe.type === 'food') {
    return (
      <div>

        {recipe.map((element) => (
          <img src={ element.image } alt={ element.name } />
        ))}
      </div>
    );
  }
  return (
    <div>Sou um card Favorito</div>
  );
}

export default FavoriteCard;
